      <View style={styles.container1}>
        <Text style={styles.Titulo}> Emilio Jose Gombo Malungo</Text>
        <Text style={styles.Titulo}>Endere√ßo:Brasil/sp - Bauru Rua:jose vicente Aiello 13129</Text>
        <Text style={styles.text}>Telefone 14996767848 / 14981058439</Text>
        <Text style={styles.Titulo}>Email:emilio.malungo@hotmail.com</Text>
      </View>
      <View style={styles.container2}>
        <Text style={styles.Titulo}> OBJETIVO</Text>
        <Text style={styles.Titulo}> Conseguir vaga como Programador </Text>
      </View>
    </View>


  );
}

